import React from 'react';
import { Link } from 'react-router-dom';  // Optional: If you're using React Router for page navigation

// Importing Bootstrap classes for styling
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';

const NavigationBar = () => {
  return (
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Container>
      
        <Navbar.Brand href="/">MyWebApp</Navbar.Brand>

      
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />

        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="ml-auto">
           
            <Nav.Link as={Link} to="/">Home</Nav.Link>

            <Nav.Link as={Link} to="/projects">Projects</Nav.Link>

         
            <Nav.Link as={Link} to="/annual-report">Annual Report</Nav.Link>

          
            <Nav.Link as={Link} to="/about-us">About Us</Nav.Link>

           
            <Nav.Link as={Link} to="/contact-us">Contact Us</Nav.Link>

       
            <NavDropdown title="More" id="collasible-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Something else here</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
export default NavigationBar;

